var Logger={setLogLevel:function(a){if(a===null){$.sap.log.setLevel($.sap.log.Level.ERROR);return}a=a.toUpperCase();if(a==="FATAL"){$.sap.log.setLevel($.sap.log.Level.FATAL)}else{if(a==="INFO"){$.sap.log.setLevel($.sap.log.Level.INFO)}else{if(a==="NONE"){$.sap.log.setLevel($.sap.log.Level.NONE)}else{if(a==="TRACE"){$.sap.log.setLevel($.sap.log.Level.TRACE)}else{$.sap.log.setLevel($.sap.log.Level.ERROR)}}}}},error:function(a){$.sap.log.error(a)},fatal:function(a){$.sap.log.fatal(a)},info:function(a){$.sap.log.info(a)},trace:function(a){$.sap.log.trace(a)},showApplicationTrace:function(){try{var g=new sap.ui.commons.Dialog();g.setTitle("Application Trace");var h=new sap.ui.commons.TextArea();h.setCols(100);h.setRows(20);h.setEditable(false);var d=$.sap.log.getLogEntries();if(d!==undefined){var j=[];for(var b=0;b<d.length;b++){var c=d[b];var a=c.date+" "+c.time+": "+c.message;if(c.level===5){a+=" "+JSON.stringify(c.details)}j.push(a)}h.setValue(j.join("\n"));g.addContent(h)}g.setModal(true);g.setShowCloseButton(true);g.open()}catch(f){alert("Could not open the application trace: "+f)}}};$(document).keydown(function(a){if(a.ctrlKey&&a.shiftKey&&a.which===90){Logger.showApplicationTrace()}});if(typeof console===undefined){console={};console.log=function(){};console.debug=function(){};console.error=function(){};console.warning=function(){}};